script: |
  super -f text -I q8543.spq | sort > q8543.out

inputs:
  - name: q8543.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT NULL BETWEEN 85 * + CAST ( NULL AS INTEGER ) * + col1 AND - - col0 + + 15 + + col2;
  - name: tab1

outputs:
  - name: q8543.out
    data: |
